import './App.css';
import {useReducer} from "react";
import TodoReducer from "./Reducer/TodoReducer";
import {addTodo, deleteTodo, toggleTodo} from "./Action/TodoActions";
import DisplayTodo from "./Component/DisplayTodo";
import {createStore} from "redux";
import {useDispatch, useSelector} from "react-redux";
import AddTodoForm from "./Component/AddTodoForm";

export const Todos = [
	{
		id: 1,
		task: "Manger le chien du voisin, il est bruyant",
		completed: true
	},
	{
		id: 2,
		task: "Se brosser les dents",
		completed: false
	}
]



function App() {

	const todos = useSelector(state => state.main)


	return (
		<>
			<AddTodoForm/>


			<ul>
				{todos.map(el => <DisplayTodo todo={el}/>)}
			</ul>
		</>
	);
}

export default App;
